import './gallery.css';

import g1 from '../../assets/g1.png'
import g2 from '../../assets/g2.png'
import g3 from '../../assets/g3.png'
import g4 from '../../assets/g4.png'
import g5 from '../../assets/g5.png'
import g6 from '../../assets/g6.png'

import GalleryImage from '../../components/galleryImage/galleryImage';
// https://knping.pl/api/v1/photos.php

const Gallery = () => {
  return <div className="gallery">
    <div className="gallery__info">
      <h1>Galeria. Tu zobaczysz jak działamy</h1>
    </div>
    <div className="gallery__grid">
      <div className="gallery__left">
        <GalleryImage imgUrl={g1} content="Warsztaty o cyberbezpieczeństwie" />
        <GalleryImage imgUrl={g2} content="Warsztaty o cyberbezpieczeństwie" />
        <GalleryImage imgUrl={g3} content="Warsztaty o cyberbezpieczeństwie" />
      </div>
      {/*<div className="gallery__right">*/}
      {/*  <GalleryImage imgUrl={g4} content="Warsztaty o cyberbezpieczeństwie" />*/}
      {/*  <GalleryImage imgUrl={g5} content="Zajęcia z zakresu phishingu" />*/}
      {/*  <GalleryImage imgUrl={g6} content="Jedne z pierwszych zajęć w ramach Ping" />*/}
      {/*</div>*/}
    </div>
  </div> 
}

export default Gallery;
